import{_,o as t,c as s,a7 as p}from"./chunks/framework.ClMj9r9D.js";const i="/images/2008/10/27_200810271630035427_6536.jpg",a="/images/2008/10/27_200810271630157150_6537.jpg",e="/images/2008/10/27_200810271630226468_6538.jpg",o="/images/2008/10/27_200810271630273373_6539.jpg",m="/images/2008/10/27_200810271630338524_6540.jpg",r="/images/2008/10/27_200810271630390048_6541.jpg",c="/images/2008/10/27_200810271630480853_6542.jpg",g="/images/2008/10/27_200810271631017046_6543.jpg",n="/images/2008/10/27_200810271631101220_6544.jpg",l="/images/2008/10/27_200810271631176722_6545.jpg",d="/images/2008/10/27_200810271631233635_6546.jpg",f="/images/2008/10/27_200810271631305183_6547.jpg",j="/images/2008/10/27_200810271631360108_6548.jpg",T="/images/2008/10/27_200810271631594601_6549.jpg",V=JSON.parse('{"title":"10月25日·东部华侨城","description":"","frontmatter":{"title":"10月25日·东部华侨城","tags":["三洲田","东部华侨城","大梅沙"],"id":1056,"categories":["Life"],"abbrlink":"debe7510","date":"2008-10-27T13:08:41.000Z"},"headers":[],"relativePath":"Life/10月25日东部华侨城.md","filePath":"Life/10月25日东部华侨城.md","lastUpdated":1719711816000}'),h={name:"Life/10月25日东部华侨城.md"},u=p('<p>东部华侨城在深圳大梅沙和三洲田那块，从科技园坐车1小时即到大峡谷，从大峡谷进去，坐云海索道到山顶，上了旋转观光塔一饱风光之后，乘坐穿梭巴士前往茶溪谷</p><p>茶溪谷是07年对外开放的，设施已经很完善了。上次参加磨房百公里有经过茶溪谷门口，只是那次人非常多，加上是刷过去的，只停留片刻。（见 {% post_link &#39;Life/3月23日·磨房百公里&#39;%} ）</p><p>一直想看百万葵园，因为喜欢向日葵那种欣欣向荣的气息，喜欢那种乐观向上的态度，可惜那天没有大太阳，向日葵都垂着头，或许就像生活的不如意，但是雨过天晴总有灿烂的明天。</p><p>茶溪谷的山间小道路面非常爽，好遗憾没带上轮滑鞋，那里刷起来肯定很爽，起码不想走路那么累。</p><p>经过索桥，往下一望，蛮高的，想到了蹦极，虽然心里有那么点恐惧，但从这个高度，应该还是敢跳下去的。</p><p><img src="'+i+'" alt=""></p><p><img src="'+a+'" alt=""></p><p><img src="'+e+'" alt=""></p><p><img src="'+o+'" alt=""></p><p><img src="'+m+'" alt=""></p><p><img src="'+r+'" alt=""></p><p><img src="'+c+'" alt=""></p><p><img src="'+g+'" alt=""></p><p><img src="'+n+'" alt=""></p><p><img src="'+l+'" alt=""></p><p><img src="'+d+'" alt=""></p><p><img src="'+f+'" alt=""></p><p><img src="'+j+'" alt=""></p><p><img src="'+T+'" alt=""></p>',19),L=[u];function S(b,k,P,$,x,A){return t(),s("div",{"data-pagefind-body":!0},L)}const v=_(h,[["render",S]]);export{V as __pageData,v as default};
